import React from 'react';
import logo from './logo.svg';
import './App.css';

class Welcome extends React.Component {
  render() {
    return <h1>This website shows Joel's Movie Collection</h1>;
  }
}

function Movies() {
  return (
    <div>
      <h2>Random Number: {Math.random}</h2>
    </div>
  );
}

class Conclusion extends React.Component {
  render() {
    return <p>Hope you enjoyed the collection!</p>;
  }
}

function App() {
  return (
    <div>
      <Welcome />
      <Movies />
      <br />
      <Conclusion />
    </div>
  );
}

export default App;
